import React from "react";
import {
  Button,
  TextField,
  Grid,
  Typography,
  Container,
  Paper,
  makeStyles,
} from "@material-ui/core";

function Options({ children }) {
  return (
    <div>
      Options
      {children}
    </div>
  );
}

export default Options;
